"use strict";angular.module("app").controller("CollectorCreate",["$scope","$state","$api","Auth","UI",function(e,o,t,c,r){c.Check(function(){e.collector={project:e.Project.selected._id},e.submit=function(){t.collector.add(e.collector,function(e){e.code?r.AlertWarning(e.message):o.go("admin.collector.info")},function(e){r.AlertError(e.data.message)})},e.isEdit=!1})}]);